import "../css/page_styles.css";
// Import Form Component
import Form from "../components/FormComponent";

const Contact = () => {
    return ( 
        <section className="contact">
            <div className="container">
                <Form for="contact" />
            </div>
        </section>
    );
}

export default Contact;
